import styled from 'styled-components'

const HeaderJR = () => {
    return (
        <>
            <HeaderMain>
                <div className="header-jr">
                    <h1>Landlines</h1>
                    <h2>M12 Studio</h2>
                </div>
            </HeaderMain>
        </>
    )
}

export default HeaderJR

const HeaderMain = styled.div`
