    z-index: 200;

    /* margin-left: 200px; */

    display: flex;
    justify-content: center;

    h1{
        display: inline-block;
        font-size: 1rem;
        letter-spacing: 1px;
        text-shadow: 0 0 15px rgba(0,0,0,1);
    }

    h2{
        display: inline-block;
        font-size: 1rem;
        font-weight: 400;
        text-shadow: 0 0 15px rgba(0,0,0, 1);
        margin-left: 1rem;

    }

    .open{
        transform: translateX(240px);
    }
`
